USE store;
CREATE TABLE mobile (
    list INT,
    list_company_list VARCHAR(16) CHARACTER SET utf8,
    list_image VARCHAR(129) CHARACTER SET utf8,
    list_link VARCHAR(98) CHARACTER SET utf8,
    list_model VARCHAR(45) CHARACTER SET utf8,
    list_price_list INT,
    list_price_del_list VARCHAR(13) CHARACTER SET utf8,
    list_ram VARCHAR(24) CHARACTER SET utf8,
    list_rating_list NUMERIC(2, 1),
    list_stock_list VARCHAR(8) CHARACTER SET utf8,
    list_title_list VARCHAR(95) CHARACTER SET utf8
);
